animal.description:
Brady is a sweet boy who lost his only home he knew due to no fault of his own. His owners gave him up because he was too big for their grandchildren. Brady is a loving boy who wants nothing more than a real family of his own forever. He is housebroken, walks well on leash, good with other dogs, cat test pending. 

This is a Pay It Forward Pup. This means his/her adoption donation will help to save another pup needing rescue and vetting. If you are interested in this puppy, please complete an adoption application.

The adoption fee is $555 which includes deworming, microchipping, 3 sets of puppy shots, rabies and neuter when old enough. After his/her neuter, you will get a $55 refund.

Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:
(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the suburbs surrounding Schaumburg (Illinois Residents only)
*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards
